import React from 'react'



const Note = ({ notes, toggleImportance }) => {
  const label = notes.important
  ? 'make not important' : 'make important'
  return (
    <>
      {notes.map(x => {<li key={x.id}>
          {x.content}
          <button onClick={toggleImportance}>{label}
          </button>
        </li>
      })}
    </>
  )
}

export default Note
